import http from "../../component/HTTP/http-common";

const getAll = () => {
  return http.get("/news");
};

const get = id => {
  return http.get(`/news/onenews/${id}`);
};

const create = data => {
  return http.post("/news", data);
};

const createIssues = data => {
  return http.post("/issues", data);
};




export default {
    getAll,
    get,
    create,
    update,
    remove,

    createIssues
  
  };
